void ScreenTableSettingsViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &toggleButton1)
    {
        //chooseTemp
        //When toggleButton1 clicked call virtual function
        //Call virtChooseTemp
        virtChooseTemp();

        //Interaction1
        //When toggleButton1 clicked execute C++ code
        //Execute C++ code
        if (textArea1.isVisible())
        {
            
            textArea1.setVisible(false);
            textArea1.invalidate();
        }
        else
        {
            textArea1.setVisible(true);
            textArea1.invalidate();
        }
    }
    else if (&src == &button2)
    {
        //Interaction2
        //When button2 clicked change screen to Screen2
        //Go to Screen2 with no screen transition
        application().gotoScreen2ScreenNoTransition();
    }
}
